import styled from 'styled-components';

const INFO_STRING =
  '안녕하세요. 저는 웹개발자 윤인배 입니다. 리액트와 장고를 좋아합니다.';

function printText(infos) {
  var contentArray = infos.split(''),
    current = 0,
    elem = this;
  setInterval(function() {
    if (current < contentArray.length) {
      elem.text(elem.text() + contentArray[current++]);
    }
  }, 100);
}

printText(INFO_STRING);

const IndexBlock = styled.div`
  display: flex;
  flex-direction: column;
  align-items: center;
  justify-content: center;
`;

const Index = () => {
  return (
    <IndexBlock>
      <h1>{printText(INFO_STRING)}</h1>
    </IndexBlock>
  );
};

export default Index;
